This is an excellent collection of more than 70 Great Funk Songs!

All the Artists of the era when Funk reached it's heights in popularity are represented here. All songs are the original versions by the original artists.

So, if you're planning a Retro New Years Party, grab this one, get out your Oversized Afro's and SuperBling Costumes and Do Da' Funk All Night Long :)

For all of you under 35: Grab this one and find out where your popular DJ's get their Samples and Inspiration from.

After All: This still is Serious Dance Music!

The original rip is from demonoids' &quot;groovbag&quot; who put it out in Apple's .aiff format (lossless as well).

I have converted it to FLAC and included covers and &quot;homemade&quot; tracklistings, so you can easy find your fav' songs easily.

Enjoy!!!

